import React from 'react'

const dummyMeals = [
    {
        id: "m1",
        name: "Burger",
        price: 250
    },
    {
        id: "m2",
        name: "Briyani",
        price: 350
    },
    {
        id: "m3",
        name: "Cake",
        price: 1250
    }
]

function AvailableMeals() {
    const mealList = dummyMeals.map(meal => { <li> {meal.name} --- Rs{meal.price}</li>  } )
    return (
        <React.Fragment>
            <ul> { mealList}</ul>
        </React.Fragment>
    )
}

export default AvailableMeals
